import axios from 'axios';

var url = 'http://localhost:8080/';

function GetAccountByID(userID) {
     url += 'accounts/' + userID;
    axios.get(url)
        .then(res=> {
            console.log(res.data)
        }).catch(err => {
        console.log(err)
    })
}

export default GetAccountByID;
